import React from 'react'
import homme from'../Asset/Img/homme.png'

export default function Presentation() {
  return (
    <div className='w-full flex items-center justify-around border border-black bg-belge py-[400px] '>
        <div className='border border-solid border-red-400'>

        </div>
        <div className=''>
            <img src={homme} alt="" />
        </div>
    </div>
  )
}
